function App() {
  return (
    <UserProvider>
      <div className="app">
        <Router>
          <Routes>
            <Route path="/create">
              <Home />
            </Route>
            <Route path="/read/:id">

            </Route>
            <Route path="/edit/:id">

            </Route>
            <Route path="/delete/:id">

            </Route>
            <Route exact path="/">
              <Home />
            </Route>
            <Route path="*">

            </Route>
          </Routes>
        </Router>
      </div>
    </UserProvider>
  );
}

export default App;
